■サイズ/はさみ全長:24cm 箱:W9.5×H2.4×D27cm<br>
■材質/刃部:工具鋼/柄部:鋼/サック:オレフィン系樹脂<br>
<br>
良質のはさみを後世に。<br>
伝統に培われたフォルムを次世代の技術で受け継いだたしかな品質のはさみです。<br>
従来、良い布切はさみを作るには、高度な職人技を要しました。布切はさみ「紫宇(しう)」は、機能の決め手となる刃の加工を、全て精密な機械で行い、高度な職人技でしか再現できなかった、理想的なブレード(刃)形状を安定して形造る製法を実現しました。<br>
<br>
一つ星より 更に向上したポイント<br>
・ 耐摩耗性の高い鋼を使用し耐久性をアップ。<br>
・ 内刃と峰(側面)に、バフ磨きを追加。美しい質感と、スムーズな開閉による、より快適な使い心地を追求。<br><br><img src="https://image.rakuten.co.jp/tukurutanosimi/cabinet/mail_ng.jpg" /><style type="text/css">
