内装業者プロ用、匠の鋏！<br>
クッションフロア、クロス、各種シート関連に抜群の性能を発揮します。<br>
<br>
国産ハイカーボンステンレス鋼を採用し、<br>
高い焼き入れ硬度を持ち、鋭利で素晴らしい切れ味です。<br>
長谷川刃物の特殊技術でミクロのフッ素被膜を全身にコーティングしており、<br>
あらゆる粘着物も寄せ付けません。<br>
<br>
<br>
長谷川刃物株式会社-CANARY-<br>
日本屈指の刃物の町「岐阜県関市」にある<br>
1933年創業の老舗刃物メーカーです。<br>
<br>
■サイズ：約全長265ｍｍ×刃渡り115ｍｍ<br>
■素材：刃/最高級ステンレス刃物鋼<br>
