一般のハサミより硬度が高く粘りのある<br>
高品質ステンレス刃物鋼(6A)を採用しており、<br>
気持ちのいい切れ味を長く使っても持続させる高い耐久性を実現。<br>
<br>
また、刃面(刃の表側)の研磨した際に生まれる角を<br>
研磨し丸いフォルムにしたことによって<br>
引っかかりのないスムーズな切り進みを可能にしました。<br>
<br>
長谷川刃物株式会社-CANARY-<br>
日本屈指の刃物の町「岐阜県関市」にある<br>
1933年創業の老舗刃物メーカーです。<br>
