■成分/シリコン、アルコール、防錆剤、リモネン<br>

■容量/7ml<br><br>

テープや接着芯の粘着剤など、はさみの刃についた汚れをすっきり落とします。<br>

シリコン配合なので汚れを付きにくくする効果もあります。はさみをサビから守る防錆剤入り。<br><br>

【使用方法】<br>

1.刃の表面の繊維クズなどをあらかじめ拭き取っておきます。<br>

2.汚れが気になる部分に液を塗り、乾いた布で汚れをこすりながら拭き取ります。<br>

拭き取り後、刃の表面を防汚・防錆成分がコーティングし、はさみを守ります。<br><br>

