オリエンタルな雰囲気の音楽を奏でるアロマミストディフューザー。<br><br>アロマディフューザー YUN(ゆん)は、カエデの間伐材とガラス素材をボディーに採用したインテリア性の高いアロマミストディフューザーです。<br><br>ガラスドームの中でミストが発生する様子が鑑賞できるほか、内蔵されたリラクゼーション系の音楽が心地よく流れ、視覚・聴覚・嗅覚の3つの感覚に対する癒し効果が期待できます。<br><br>ガラスドーム内部にはリモコンで色変更が可能なLEDライトが搭載されており、ミストの流れを幻想的な光で演出いたします。<br>YUN本体内蔵のリラクゼーション音楽が楽しめるほか、外部入力端子によりスマートフォンや携帯オーディオプレーヤー等も接続することができるので、お好みの音楽でアロマをお楽しみ頂けます。<br><br><table width=400 border=0 cellpadding=10 cellspacing=2 bgcolor=#555555><tr><th width=150 bgcolor=#DDDDDD>商品名</th><td width=250 bgcolor=#FFFFFF>アロマミストディフューザー ＹＵＮ（ゆん）<br></td></tr><tr><th bgcolor=#DDDDDD>セット内容</th><td bgcolor=#FFFFFF>本体、リモコン、オーディオケーブル（外部音楽端末接続用）<br></td></tr><tr><th bgcolor=#DDDDDD>サイズ</th><td bgcolor=#FFFFFF>直径217mm×高さ155mm<br></td></tr><tr><th bgcolor=#DDDDDD>重さ</th><td bgcolor=#FFFFFF>1.2kg<br></td></tr><tr><th bgcolor=#DDDDDD>型番</th><td bgcolor=#FFFFFF>08-802-6040<br>JAN：4954753047163<br></td></tr><tr><th bgcolor=#DDDDDD>メーカー・販売元</th><td bgcolor=#FFFFFF>株式会社生活の木<br></td></tr><tr><th bgcolor=#DDDDDD>その他仕様</th><td bgcolor=#FFFFFF>使用許容範囲：約6～10畳<br>タンク容量：約250ml、タイマー機能（1/2/3H）<br>電源：AC100V<br>エネルギー：15w</td></tr></table><br><br><font color=red>※商品画像につきまして、カラーはブラウザや設定により実物とは若干異なる場合がございます。<br>また、メーカー様の都合により予告なくパッケージが変更となる可能性があります。<br>あらかじめご了承くださいますようよろしくお願い致します。</font><br><br><font size=1>【検索用】
